import React from "react";

const person = (props) =>{
    return (
        <div>
            <p onClick={props.click}>Well I'm {props.name} and I'm {props.age} years old</p>
            <p>{props.children}</p>
            <input onChange={props.changed} value={props.name}></input>
        </div>
    )
};

export default person;
